import { Col, Container } from "react-bootstrap";
import "./Leftbar.css";

const Leftbar = () => {
    return ( 
        <Col md={3} className="text-white" style={{background: "#121212", height: '1000px'}}>
            <div style={{}}>
            <Container>
            <h1>Hello World!</h1>
            </Container>
            </div>
        </Col>
     );
}

export default Leftbar;
